  constructor() {
    super(props);
  }


render() {
  const RecipeList = this.props.recipeList.map((recipe, i) => {
    return <Recipe
      key={i}
      {...recipe}
      recipeCallback={() => this.props.RecipeCallback(recipe)}
    />
  });

  return(
    <div>
      <div>
        {RecipeList}
      </div>
    </div>
  )
}






}

export default Recipes;
